import React from 'react';
import logo from './logo512.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          airbnb
        </p>
        <a
          className="App-link"
          href="https://www.airbnb.ru/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Official site
        </a>
      </header>
    </div>
  );
}

export default App;
